<script>
    $(document).ready(function () {

        function validateEmail($email) {
            var emailReg = /^([\w-\.]+@([\w-]+\.)+[\w-]{2,4})?$/;
            return emailReg.test($email);
        }

        $(".btn-back").on({
            mouseenter: function () {
                $('.btn-back > svg').attr("class", "").removeClass('d-none');
                $('.btn-back').css({
                    'border': '1px solid #008080'
                });
            },
            mouseleave: function () {
                $('.btn-back > svg').attr("class", "d-none");
                $('.btn-back').css({
                    'border': 'none'
                });
            }
        });

        $("input[type='number']").on('keypress', function (e) {
            return e.metaKey || // cmd/ctrl
                e.which <= 0 || // arrow keys
                e.which == 8 || // delete key
                /[0-9]/.test(String.fromCharCode(e.which)); // numbers
        });

        $(".btn-continue").on({
            mouseenter: function () {
                $('.btn-continue > svg').attr("class", "").removeClass('d-none');
            },
            mouseleave: function () {
                $('.btn-continue > svg').attr("class", "d-none");
            }
        });


        $("#firstName").on("input", function (event) {
            var inputValue = this.value;
            this.value = this.value.replace(/[0-9]/g, "")
        });

        $("#lastName").on("input", function (event) {
            var inputValue = this.value;
            this.value = this.value.replace(/[0-9]/g, "")
        });

        $("#suffix").on("input", function (event) {
            var inputValue = this.value;
            this.value = this.value.replace(/[0-9]/g, "")
        });

        $("input").change(function () {
            $(this).removeClass('danger');
            $(this).css({
                'background': '#F7FCFF'
            });

            $(this).prev().closest('p').css({
                'background': '#F7FCFF'
            });
        });

        $("select").change(function () {
            $(this).removeClass('danger');
            $(this).css({
                'background': '#F7FCFF'
            });

            $(this).prev().closest('p').css({
                'background': '#F7FCFF'
            });
        });

        $("#emailAddress").change(function () {

            var email = $("#emailAddress").val();

            if (!validateEmail(email)) {


                $("#emailAddress").addClass('danger');

                $("#emailAddress").prev().closest('p').css({
                    'background': '#FFF7F7'
                });
            }
        });
    });
</script>
